import React from 'react';
import { useHistory } from 'react-router-dom';
import "./Home.css";
import Footer from './Footer';

const Home = () => {

  const history = useHistory();

  const handleOrderClick = () => {
    history.push('/order-pizza');
  };

  return (
    <body>
    <header>
      <h1>Teknolojik Yemekler</h1>
      <p className='satisfy-text'>fırsatı kaçırma</p>
      <p className='text'>KOD ACIKTIRIR</p>
      <p className='text'>PİZZA DOYURUR</p>
      <button id="order" onClick={handleOrderClick}>ACIKTIM</button>
    </header>
    <div className='contents'>
    <svg width="42" height="42" viewBox="0 0 42 42" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
      <rect width="42" height="42" fill="url(#pattern0)"/>
      <defs>
        <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
          <image xlinkHref="data:image/png;base64," preserveAspectRatio="xMidYMid slice" width="1" height="1"/>
        </pattern>
      </defs>
    </svg>

    </div>
    <Footer/>
    </body>
  );
};

export default Home;
